features.script:
feature.on('trigger', (e)=> {

  console.log('Door Triggered');  
  let door = parcel.getFeatureById('door3');  
  let innerButton = parcel.getFeatureById('InnerButton');
  let buttonColor = innerButton.get('color');
  console.log(buttonColor);

  if (buttonColor == 'blue')
  {
    console.log('Opening door');  
    innerButton.set({color:'green'});

    let anim1 = door.createAnimation('position');        

    anim1.setKeys(
      [{
          frame: 0,
          value: door.position.add(new Vector3(0, 0, 0) )
        }
        ,
        {
          frame: 50,
          value: door.position.add(new Vector3(1.45, 0, 0) )
        }        
      ]) 

    door.startAnimations([anim1]);  

  }



})

feature.on('trigger', (e)=> {
    console.log('Hissing snake');

  let snakeSound = parcel.getFeatureById('snakeHissMp3');



     // hit play
    snakeSound.play();   

})

