feature.on('click',e=>{

    let oasisRadio= parcel.getFeatureById('oasisRadio');
    let station = 'https://www.youtube.com/watch?v=rXsZk4Mz_Ac'
    let currentStation = oasisRadio.get('url');



    if (currentStation == station)
    {
        oasisRadio.set({'url':''});      
        oasisRadio.pause();
    }
    else
    {
        oasisRadio.set({'url':station});      
        oasisRadio.play();         
    }


})
